Come hike Bear Canyon Trail with SC professors of anthropology, Erin Moore and Craig Stanford!

A former attorney, Professor Moore’s primary research and teaching focus on law and gender in rural India. In her law practice, she represented migrant farmworkers from central Washington State through a legal services corporation. Moore produced an award-winning film on rural Indian women and the law entitled, &quot;Keep Her Under Control: Law's Patriarchy in India.&quot;

In addition to her wonderful self, Professor Moore is bringing husband, Professor Craig Stanford, another USC professor whose work has often focused on the ecological relationships among the primate species sharing a tropical forest ecosystem. Stanford's research has been profiled in the New York Times, Los Angeles Times and other national newspapers, and he is a frequent guest on television and radio programs about human origins and animal behavior.

