One of the most epic weekends Peaks and Professors has ever been fortunate enough to put together. Check out this list:
&lt;ul&gt;
	&lt;li&gt;Overnight camping at a professor's private residence in Malibu? Check.&lt;/li&gt;
	&lt;li&gt;Hiking some of the tallest mountains in the Santa Monicas? Check.&lt;/li&gt;
	&lt;li&gt;Visiting tidepools at sunset? Check.&lt;/li&gt;
	&lt;li&gt;Eating delicious food roasted on a campfire, finishing with s'mores, and sleeping under the stars? Check.&lt;/li&gt;
	&lt;li&gt;Larry Harris, one of USC's foremost financial experts and an avid outdoorsman, welcoming us at his place for the weekend? Also check.&lt;/li&gt;
&lt;/ul&gt;
We're going to have an incredible time, and really hope you can join us. Professor Harris, former Chief Economist at the SEC and one of USC's experts on finance, has graciously opened his Malibu home to us, and is working with us to prepare a fantastic weekend of hiking, sunset watching, eating, and stargazing. Psyched? Heck yeah.
